Sectorul 6 al Municipiului Bucureti (Primria Sector 6) planific, organizeaz i finalizeaz procedura de achiziie comun ocazional conform art. 44 din Legea 98/2016 cu modificrile i completrile ulterioare, n numele i pentru utilizatorii definii mai jos, precum i monitorizarea acordului-cadru i a contractelor subsecvente centralizate, mpreun cu acetia:
1.	Direcia General de Asisten Social i Protecia Copilului Sector 6; 
2.	Administraia Domeniului Public i Dezvoltare Urban Sector 6; 
3.	Administraia Comercial Sector 6;
4.	Direcia General de Poliie Sector 6; 
5.	Centrul Cultural European Sector 6;
6.	Administraia colilor Sector 6;
7.	Centrul de sntate Multifuncional Sfntul Nectarie Sector 6;
8.	Direcia de Eviden a Persoanelor Sector 6; 
9.	Direcia General de Impozite i Taxe Locale Sector 6;
10.	Centrul Militar Sector 6.
Valoarea estimat a celui mai mare contract subsecvent este de 1.840.000 lei fr TVA.
